import React from "react";
import { Badge, TabBar,Image } from "antd-mobile";

import styled from "styled-components"


const TabBarBox = styled.div`
    
`

const TabBarAction = function TabBarAction(){
  const tabs = [
    {
      key: "greenHouses",
      title: "大棚",
      icon:<Image src={require("../assets/images/1.png")}/>
    },
    {
      key: "farm",
      title: "农场",
      icon: <Image src={require("../assets/images/2.png")}/>
    },
    {
      key: "home",
      title: "我的",
      icon:<Image src={require("../assets/images/3.png")}/>,
    }
  ];

  return <TabBarBox>
      <TabBar>
        {tabs.map((item) => (
          <>
            <img src="../assets/images/1.png" alt="" />
            <TabBar.Item key={item.key} title={item.title} icon={item.icon}/>
          </>
        ))}
      </TabBar>
  </TabBarBox>
};

export default TabBarAction;
